export const lightboxOptions = {
    buttons: {
        showAutoplayButton: false,
        showDownloadButton: false,
        showNextButton: false,
        showPrevButton: false
    },

    thumbnails: {
        showThumbnails: false
    },

    settings: {
        lightboxTransitionSpeed: .03,
        overlayColor: 'rgba(255, 255, 255, 0.97)'
    }
}
